import { Hex } from "viem";
import { envBigInt, envHex } from "./envBigInt";
import { ENTRYPOINT_V6, ENTRYPOINT_V8, IMPLEMENTATION } from "../data/addresses";
import { buildFactoryV6InitCode, buildMinimalAccountInitCode, buildPaymasterV2InitCode } from "./initCode";

import 'dotenv/config'

const { FACTORY_V6_SALT } = process.env as Record<
    string,
    Hex
>

export interface ContractToDeploy {
    creationByteCode: Hex;
    address: Hex;
    name: string;
    path: string | null;
    isExist: boolean | null;
    salt: Hex | null;
    initCode: Hex | null;
}

const INITIAL_GUARDIAN = envHex('INITIAL_GUARDIAN');
const RECOVERY = envBigInt('RECOVERY');
const SECURITY = envBigInt('SECURITY');
const WINDOW = envBigInt('WINDOW');
const LOCK = envBigInt('LOCK');

export class ContractsToDeploy {
    static MinimalAccount: ContractToDeploy = 
    {   name: 'MinimalAccount',
        path : 'src/Account.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV2: ContractToDeploy = 
    {   name: 'MinimalAccountV2',
        path : 'src/AccountV2.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV3: ContractToDeploy = 
    {   name: 'MinimalAccountV3',
        path : 'src/AccountV3.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV4: ContractToDeploy = 
    {   name: 'MinimalAccountV4',
        path : 'src/AccountV4.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV5: ContractToDeploy = 
    {   name: 'MinimalAccountV5',
        path : 'src/AccountV5.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV6: ContractToDeploy = 
    {   name: 'MinimalAccountV6',
        path : 'src/AccountV6.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV7: ContractToDeploy = 
    {   name: 'MinimalAccountV7',
        path : 'src/AccountV7.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV8: ContractToDeploy = 
    {   name: 'MinimalAccountV8',
        path : 'src/AccountV8.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static MinimalAccountV9: ContractToDeploy = 
    {   name: 'MinimalAccountV9',
        path : 'src/AccountV9.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex
    } as ContractToDeploy;

    static PaymasterV6: ContractToDeploy = 
    {   name: 'PaymasterV6',
        path : 'src/OpenfortPaymasterV2/contracts/paymaster/OpenfortPaymasterV2.sol',
        isExist: false,
        salt: FACTORY_V6_SALT,
        creationByteCode: '' as Hex 
    } as ContractToDeploy;

    static getAllContracts(): ContractToDeploy[] {
        return [
            // ContractsToDeploy.MinimalAccount,
            ContractsToDeploy.MinimalAccountV2,
            ContractsToDeploy.MinimalAccountV3,
            // ContractsToDeploy.MinimalAccountV4,
            // ContractsToDeploy.MinimalAccountV5,
            // ContractsToDeploy.MinimalAccountV6,
            // ContractsToDeploy.MinimalAccountV7,
            // ContractsToDeploy.MinimalAccountV8,
            // ContractsToDeploy.MinimalAccountV9,
            // ContractsToDeploy.PaymasterV6,
        ];
    }

    static computeInitCode (c: ContractToDeploy, address: Hex): Hex {
        switch (c.name) {
            case 'MinimalAccount':
            case 'MinimalAccountV2':
            case 'MinimalAccountV3':
            case 'MinimalAccountV4':
            case 'MinimalAccountV5':
            case 'MinimalAccountV6':
            case 'MinimalAccountV7':
            case 'MinimalAccountV8':
            case 'MinimalAccountV9':
            return buildMinimalAccountInitCode(
                address,
                ENTRYPOINT_V6,
                IMPLEMENTATION,
                RECOVERY,
                SECURITY,
                WINDOW,
                LOCK,
                INITIAL_GUARDIAN,
                c.creationByteCode,
            )

            case 'PaymasterV6':
            return buildPaymasterV2InitCode(
                ENTRYPOINT_V6,
                address,
                c.creationByteCode,
            )

            case 'FactoryV6':
            return buildFactoryV6InitCode(
                address,
                ENTRYPOINT_V8,
                IMPLEMENTATION,
                RECOVERY,
                SECURITY,
                WINDOW,
                LOCK,
                INITIAL_GUARDIAN,
                c.creationByteCode,
            )

            default:
            return c.creationByteCode
        }
    }
}
